import React from 'react';
import { ScrollView, StyleSheet, Text, View, FlatList, TouchableOpacity, Image } from 'react-native';
import axios from 'axios';




export default class ProductsScreen extends React.Component {

  state = {
    loading:true
  }
  async componentDidMount(){

    const url = "http://drugshoppa.ng/wp-json/wc/v3/products?oauth_consumer_key=ck_aaef5c823b0fabaf2958613ac0c8f60520f42150&oauth_signature_method=HMAC-SHA1&oauth_timestamp=1604806276&oauth_nonce=AzTsmgmM34o&oauth_version=1.0&oauth_signature=U44TcPLd2vxA2iy5ZsLaCph1XWg=";

    const response = await fetch(url);

    const data = await response.json();

    console.log(data);
  }





  render() {
    return (
      <View>
        {this.state.loading }<View></View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 10,
    backgroundColor: '#f6f6f6',
  },
  list: {
    flexDirection: 'column'
  },
  listItem: {
    width: '50%'
  },
  view: {
    padding: 10
  },
